import React, { Component } from 'react'
import UserService from './../../../service/user.service'

import './UserList.css'

class UserList extends Component {
    constructor() {
        super()
        this.state = {
            users: []
        }
    }

    getAllUsers = () => {
        this.userService.getUsers()
            .then(response => this.setState)
    }

    componentDidMount = () => {
        this.getAllUsers()
    }
    render() {
        return (
            <h1>Hola</h1>
        )
    }
}
export default UserList
